assert ik.newport.agilis.agilis_error_message(0) == 'No error'
assert ik.newport.agilis.agilis_error_message(-6
    ) == 'Not allowed in current state'
assert ik.newport.agilis.agilis_error_message(1
    ) == 'An unknown error occurred.'
assert ik.newport.agilis.agilis_error_message(-7
    ) == 'An unknown error occurred.'
assert ik.newport.agilis.agilis_error_message(-7.5
    ) == 'Error code is not an integer.'
assert ik.newport.agilis.agilis_error_message('TE0'
    ) == 'Error code is not an integer.'
